import React, { useState } from 'react'

const Radio = () => {
  const [selectedOption, setSelectedOption] = useState('');
  const [textFieldValue, setTextFieldValue] = useState('');

  const handleRadioButtonChange = (event) => {
    setSelectedOption(event.target.value);
    if (event.target.value === '') {
      setTextFieldValue('');
    } else {
      setTextFieldValue(event.target.value);
    }
  };

  return (

<div className='container'>
    <div class="form-check">
    <input class="form-check-input" type="radio" name="flexRadioDefault" id="flexRadioDefault1" onChange={handleRadioButtonChange}/>
    <label class="form-check-label" for="flexRadioDefault1"> Ract</label>
    </div>
    <div class="form-check">
    <input class="form-check-input" type="radio" name="flexRadioDefault" id="flexRadioDefault2" checked onChange={handleRadioButtonChange}/>
    <label class="form-check-label" for="flexRadioDefault2"> vue.js</label>
    </div>
    <div class="form-check">
    <input class="form-check-input" type="radio" name="flexRadioDefault" id="flexRadioDefault2" />
    <label class="form-check-label" for="flexRadioDefault2">angular js</label>
    </div>
</div>
 
  )
}

export default Radio
